/* eslint-disable jsx-a11y/iframe-has-title */
import React,{useState,useEffect} from 'react';
import { createMuiTheme, ThemeProvider } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import Style from './Style/Login';
import image from '../Images/background.jpeg'

const theme = createMuiTheme({
    typography: {
      fontSize: 25,
    },
  });


function AdminHome() {

  const classes = Style();

  useEffect(() => {
  return () => {
    console.log("cleaned up");
  };
  }, []);
  return (
      <div>
          <ThemeProvider theme={theme}>
             <React.Fragment>
                <div className={classes.menu}>
                <div className={classes.head}>
                    <h3 className={classes.mainHead}>Health App</h3>
                </div>
                <div className={classes.subMenu}>

                </div>
                </div>
                <div className={classes.container}>
                    <div className={classes.loginContainer}>
                    <form required 
                            // error={error}  onSubmit={(e) => { e.preventDefault(); handleSubmit(); } } component="fieldset" className={classes.form}
                             >
                        <TextField
                            variant="outlined"
                            margin="normal"
                            fullWidth
                            id="standard-required"
                            label="Health Center Name"
                            name="name"
                            autoComplete="off"
                            // onFocus={()=>{setErrors({...errors,"name":false});
                            // setErrorMessage({...errorMessage,"name":""})}} 
                            // error={errors["name"]}
                            // helperText={errorMessage["name"]}
                            autoFocus
                            // value={state.name}
                            // onChange={handleInputChange}
                        />
                        <TextField
                            variant="outlined"
                            margin="normal"
                            fullWidth
                            id="standard-required"
                            label="Email"
                            name="name"
                            autoComplete="off"
                            // onFocus={()=>{setErrors({...errors,"name":false});
                            // setErrorMessage({...errorMessage,"name":""})}} 
                            // error={errors["name"]}
                            // helperText={errorMessage["name"]}
                            // autoFocus
                            // value={state.name}
                            // onChange={handleInputChange}
                        />
                        <div className={classes.formButton}>  
                        <Button variant="contained" fullWidth 
                                // className={classes.reset} onClick={reset}  disabled={stateLoading || stageLoading}
                                >
                                Clear
                            </Button>

                            <Button
                                type="submit"
                                variant="contained"
                                color="red"
                                // disabled={stateLoading || stageLoading}
                                fullWidth
                                id='submit'
                                className={classes.submit}
                            >
                                Login
                            </Button>
                        </div>
                        </form>
                    </div>
                    <div className={classes.sideImage}>
                     <img src={image} width="50%" style={{borderRadius:'1rem'}}/>
                    </div>
                </div>
             </React.Fragment>
          </ThemeProvider>
      </div>
    );
}
export default AdminHome;
